Hi, I'm Jack. I am a male adult Bassett Hound mix and weigh around 54 pounds. I came to AHF will Jill, who is also a Bassett Hound mix. We are very close and do not like being away from each other, so we are looking to get into a home together. I am neutered, current on my vaccinations, and I am microchipped. Jill and I are even good with cats. As I mentioned, Jill and I need to go into a home together, but what is better than double the fun. We both love people and love to have fun. One thing about me is that I did test positive for heartworm, but I have already been treated and am doing well.

If you are looking for a pair of fun-loving characters, please check us out. You will not be sorry.


